    public static int[] twoSum(int[] numbers, int target) {
        int[] result = {-1, -1};
        if(numbers == null)
            return result;
        HashMap<Integer, Integer> map = new HashMap<Integer, Integer>();
        for(int i = 0; i < numbers.length; i++){
            if(map.containsKey(numbers[i])){
                result[0] = map.get(numbers[i]) + 1;
                result[1] = i + 1;
                break;
            } else {
                map.put(target-numbers[i], i);
            }
        }
        return result;

    }

    /**
     * https://oj.leetcode.com/problems/median-of-two-sorted-arrays/
     * https://oj.leetcode.com/submissions/detail/9009719/
     */
    public static double findMedianSortedArrays(int A[], int B[]) {
        int aLen = A.length;
        int bLen = B.length;
        int len = aLen+bLen;
        if(len % 2 == 0)
            return (kthElement(A, B, len/2-1, 0, aLen-1, 0, bLen-1)
                    + kthElement(A, B, len/2, 0, aLen-1, 0, bLen-1)) * 0.5;
        else
            return kthElement(A, B, len/2, 0, aLen-1, 0, bLen-1);
    }

    private static int kthElement(int[] A, int[] B, int k, int aStart, int aEnd, int bStart, int bEnd){
        int aLen = aEnd - aStart + 1;
        int bLen = bEnd - bStart + 1;

        if(aLen <= 0 || A.length <= 0)
            return B[bStart+k];
        if(bLen <= 0 || B.length <= 0)
            return A[aStart+k];
        if(k==0)
            return Math.min(A[aStart+k], B[bStart+k]);

        int aMid = k * aLen/(aLen+bLen);
        int bMid = k - aMid - 1;
        aMid = aStart+aMid;
        bMid = bStart+bMid;

        if(A[aMid]>=B[bMid]){
            k = k - (bMid-bStart+1);
            aEnd = aMid;
            bStart = bMid+1;
        } else{
            k = k - (aMid-aStart+1);
            bEnd = bMid;
            aStart = aMid+1;
        }
        return kthElement(A, B, k, aStart, aEnd, bStart, bEnd);

    }

    /**
     * https://oj.leetcode.com/problems/longest-substring-without-repeating-characters/
     * https://oj.leetcode.com/submissions/detail/9010153/
     *
     */
    public static int lengthOfLongestSubstring(String s) {
        if(s == null)
            return 0;
        if(s.length() <= 1)
            return s.length();
        int longest = 1;
        int i = 0;
        int j = 1;
        for(j = 1; j < s.length(); j++){
            int index = s.substring(i, j).indexOf(s.charAt(j));
            if(index >= 0){
                if(j-i > longest)
                    longest = j - i;
                i = i + index + 1;
            }
        }
        if(j-i> longest)
            longest = j - i;
        return longest;

    }

    /**
     * https://oj.leetcode.com/problems/add-two-numbers/
     * https://oj.leetcode.com/submissions/detail/9011366/
     *
     */
    public static ListNode addTwoNumbers(ListNode l1, ListNode l2) {
        ListNode sentinel = new ListNode(0);
        ListNode p = sentinel;
        int carry = 0;
        while (l1 != null || l2 != null) {
            if (l1 != null) {
                carry += l1.val;
                l1 = l1.next;
            }
            if (l2 != null) {
                carry += l2.val;
                l2 = l2.next;
            }
            ListNode n = new ListNode(carry % 10);
            p.next = n;
            p = n;
            carry /= 10;


        }
        if (carry == 1) {
            p.next = new ListNode(carry);
        }

        return sentinel.next;

    }

    /**
     * https://oj.leetcode.com/problems/longest-palindromic-substring/
     * https://oj.leetcode.com/submissions/detail/9012368/
     *
     */
    public static String longestPalindrome(String s) {
        if(s == null)
            return null;
        if(s.length() == 1)
            return s;
        String longest = s.substring(0, 1);
        for(int i = 0; i <= s.length()-2; i++){
            String pStr = expend(s, i, i);
            String qStr = expend(s, i, i+1);
            if(pStr.length() > longest.length())
                longest = pStr;
            if(qStr.length() > longest.length())
                longest = qStr;
        }
        return longest;

    }

    private static String expend(String s, int i, int j){
        if(s == null || i< 0 || i > s.length() -1 || j < 0 || j > s.length() - 1 || i > j || s.charAt(i) != s.charAt(j))
            return "";

        while(i >= 0 && j < s.length() && s.charAt(i) == s.charAt(j)){
            i--;
            j++;
        }
        return s.substring(i+1, j);
    }

    public static Set<String> longestPalindromSubStrings1(String s){
        Set<String> results = new HashSet<String>();

        if(s.isEmpty())
            return null;

        if(s.length() == 1){
            results.add(s);
            return results;
        }

        int longest = 1;

        for(int i = 0; i < s.length(); i++){
            String l = expend(s, i, i);
            if(l.length() == longest){
                results.add(l);
            }else if(l.length() > longest){
                results.clear();
                results.add(l);
                longest = l.length();
            }

            l = expend(s, i, i + 1);
            if(l.length() == longest){
                results.add(l);
            }else if(l.length() > longest){
                results.clear();
                results.add(l);
                longest = l.length();
            }

        }
        return results;

    }

    /**
     * https://oj.leetcode.com/problems/reverse-integer/
     * https://oj.leetcode.com/submissions/detail/9012870/
     */
    public static int reverse(int x) {
        int sign = 1;
        if(x < 0){
            sign = -1;
            x = x * (-1);
        }
        int result = 0;
        while(x > 0){
            result = 10 * result + x % 10;
            x /= 10;
        }
        return sign * result;

    }


    /**
     *   http://www.programcreek.com/2012/12/leetcode-string-to-integer-atoi/
     *   https://oj.leetcode.com/submissions/detail/9014031/
     **/
    public static int atoi(String str){
        if(str == null || str.trim().length() == 0)
            return 0;

        str = str.trim();

        int sign = 1;
        int i = 0;


        if(str.charAt(0) == '+'){
            i++;
        }
        if(str.charAt(0) == '-') {
            sign = -1;
            i++;
        }

        double result = 0.0;

        while(i < str.length() && str.charAt(i) >= '0' && str.charAt(i) <= '9'){
            result = 10.0 * result + (str.charAt(i) - '0');
            i++;
        }

        result = sign * result;

        if(result >= Integer.MAX_VALUE)
            return Integer.MAX_VALUE;

        if(result <= Integer.MIN_VALUE)
            return Integer.MIN_VALUE;

        return (int)result;

    }

    /**
     * https://oj.leetcode.com/problems/palindrome-number/
     * https://oj.leetcode.com/submissions/detail/9014691/
     */
    public static boolean isPalindrome(int x) {
        if(x < 0)
            return false;
        if(x < 10)
            return true;
        int div = 10;
        while(x / div >= 10)
            div *= 10;
        while(div >=10){
            int left = x / div;
            int right = x % 10;
            if(left != right)
                return false;
            x = (x % div) / 10;
            div /= 100;
        }
        return true;

    }

    /**
     * https://oj.leetcode.com/problems/regular-expression-matching/
     * https://oj.leetcode.com/submissions/detail/9016055/
     */
    public static boolean isMatch(String s, String p) {
        if(s == null)
            return p == null;
        if(p == null)
            return s == null;

        if(p.length() == 0)
            return s.length() == 0;

        if(p.length() == 1 || p.charAt(1) != '*'){
            if(s.length() < 1 || (p.charAt(0) != '.' && p.charAt(0) != s.charAt(0)))
                return false;
            return isMatch(s.substring(1), p.substring(1));
        } else {
            int i = -1;
            while(i < s.length() && (i < 0 || p.charAt(0) == '.' || p.charAt(0) == s.charAt(i))){
                if(isMatch(s.substring(i+1), p.substring(2)))
                    return true;
                i++;
            }
            return false;
        }

    }


    /**
     * https://oj.leetcode.com/problems/longest-common-prefix/
     * https://oj.leetcode.com/submissions/detail/9113380/
     *
     */
    public static String longestCommonPrefix(String[] strs) {
        if(strs.length == 0)
            return "";

        String s = strs[0];
        int lo = 0, hi = s.length() - 1;

        while(lo <= hi){
            int mid = lo + (hi - lo)/2;
            if(isCommonPrefix(s.substring(lo, hi + 1), strs, lo))
                break;
            else if (isCommonPrefix(s.substring(lo, mid + 1), strs, lo))
                lo = mid + 1;
            else
                hi = mid - 1;
        }
        if(hi >= 0)
            return s.substring(0, hi + 1);
        else
            return "";

    }

    private static boolean isCommonPrefix(String s, String[] strs, int start){
        for(String str : strs){
            if(str.substring(start).indexOf(s) != 0)
                return false;
        }
        return true;

    }

    /**
     * https://oj.leetcode.com/problems/3sum/
     * https://oj.leetcode.com/submissions/detail/9259432/
     */
    public static List<List<Integer>> threeSum(int[] num) {
        Set<List<Integer>> set = new HashSet<List<Integer>>();
        Arrays.sort(num);

        for(int i = 0; i <= num.length - 3; i++){
            int j = i + 1, k = num.length - 1;
            while(j < k){
                int sum = num[i] + num[j] + num[k];
                if(sum < 0){
                    j++;
                } else if (sum > 0){
                    k--;
                } else {
                    List<Integer> r = new ArrayList<Integer>();
                    r.add(num[i]);
                    r.add(num[j]);
                    r.add(num[k]);
                    set.add(r);
                    j++;
                    k--;

                }
            }
        }
        List<List<Integer>> result = new ArrayList<List<Integer>>();
        for(List<Integer> s : set){
            result.add(s);
        }
        return result;

    }

    /**
     * https://oj.leetcode.com/problems/3sum-closest/
     * https://oj.leetcode.com/submissions/detail/9260441/
     *
     */
    public static int threeSumClosest(int[] num, int target) {
        Arrays.sort(num);
        int min = Integer.MAX_VALUE;
        int result = 0;

        for (int i = 0; i <= num.length - 3; i++) {
            int j = i + 1;
            int k = num.length - 1;

            while (j < k) {
                int sum = num[i] + num[j] + num[k];
                int diff = Math.abs(sum - target);

                if (diff < min) {
                    min = diff;
                    result = sum;
                }

                if (sum == target) {
                    return sum;
                } else if (sum < target) {
                    j++;
                } else {
                    k--;
                }


            }


        }
        return result;

    }

    /**
     * https://oj.leetcode.com/problems/swap-nodes-in-pairs/
     * https://oj.leetcode.com/submissions/detail/9273396/
     */
    public ListNode swapPairs(ListNode head) {
        if (head == null)
            return head;
        ListNode p = head;
        while (p != null) {
            ListNode q = p.next;

            if (q != null) {
                int temp = p.val;
                p.val = q.val;
                q.val = temp;
                p = q.next;

            } else {
                break;
            }


        }
        return head;


    }


    /**
     * https://oj.leetcode.com/problems/4sum/
     * https://oj.leetcode.com/problems/4sum/
     */
    public static List<List<Integer>> fourSum(int[] num, int target) {
        Set<List<Integer>> set = new HashSet<List<Integer>>();
        Arrays.sort(num);




        for(int i = 0; i <= num.length - 4; i++){
            for(int j = i + 1; j <= num.length - 3; j++){
                int m = j + 1;
                int n = num.length - 1;

                while(m < n) {
                    int sum = num[i] + num[j] + num[m] + num[n];

                    if (sum == target) {
                        List<Integer> l = new ArrayList<Integer>();
                        l.add(num[i]);
                        l.add(num[j]);
                        l.add(num[m]);
                        l.add(num[n]);
                        set.add(l);
                        m++;
                        n--;
                    } else if (sum < target) {
                        m++;
                    } else {
                        n--;
                    }
                }
            }
        }
        List<List<Integer>> result = new ArrayList<List<Integer>>();
        for(List<Integer> s : set){
            result.add(s);
        }
        return result;

    }

    /**
     * https://oj.leetcode.com/problems/remove-nth-node-from-end-of-list/
     * https://oj.leetcode.com/submissions/detail/9265681/
     *
     */
    public ListNode removeNthFromEnd(ListNode head, int n) {
        if (head == null)
            return head;
        if (n <= 0)
            return head;

        ListNode p = head;
        ListNode q = head;

        int count = 0;
        for (int i = 0; i <= n - 1 && q != null; i++) {
            q = q.next;
            count++;
        }

        if (count < n)
            return head;

        else {
            if (q == null)
                return head.next;
            else {
                while (q.next != null) {
                    p = p.next;
                    q = q.next;
                }
                if (p.next != null)
                    p.next = p.next.next;
            }
        }
        return head;

    }

    /**
     * https://oj.leetcode.com/problems/valid-parentheses/
     * https://oj.leetcode.com/submissions/detail/9269784/
     */
    public boolean isValid(String s) {
        Stack<Character> stack = new Stack<Character>();

        for (int i = 0; i < s.length(); i++) {
            char c = s.charAt(i);

            if (c == '{' || c == '(' || c == '[')
                stack.push(c);
            else if (c == '}' && (stack.isEmpty() || stack.pop() != '{')) {
                return false;
            } else if (c == ')' && (stack.isEmpty() || stack.pop() != '(')) {
                return false;
            } else if (c == ']' && (stack.isEmpty() || stack.pop() != '[')) {
                return false;
            }

        }
        return stack.isEmpty();

    }

    /**
     * https://oj.leetcode.com/problems/generate-parentheses/
     * https://oj.leetcode.com/submissions/detail/9270187/
     */
    public static List<String> generateParenthesis(int n) {
        List<String> parenthesis = new ArrayList<String>();
        if(n==0) {
            parenthesis.add("");
            return parenthesis;
        }

        generateParenthesisHelper(parenthesis, n, 0, 0, "");
        return parenthesis;

    }
    private static void generateParenthesisHelper(List<String> parenthesis, int n, int left, int right, String s){
        if(left == n){
            for(int i = 0; i < n - right; i++)
                s += ")";

            parenthesis.add(s);


        } else if (left > right){
            generateParenthesisHelper(parenthesis, n, left+1, right, s+"(");
            generateParenthesisHelper(parenthesis, n, left, right + 1, s+")");
        } else if(left == right){
            generateParenthesisHelper(parenthesis, n, left+1, right, s+"(");
        }
    }

    /**
     * https://oj.leetcode.com/problems/merge-k-sorted-lists/
     * https://oj.leetcode.com/submissions/detail/9271178/
     */
    public ListNode mergeKLists(List<ListNode> lists) {
        if(lists == null)
            return null;

        PriorityQueue<Integer> pq = new PriorityQueue<Integer>();
        for(ListNode node : lists){
            while(node != null){
                pq.add(node.val);
                node = node.next;
            }
        }


        ListNode res = new ListNode(0);
        ListNode tail = res;

        while(!pq.isEmpty()){
            tail.next = new ListNode(pq.poll());
            tail = tail.next;
        }

        return res.next;

    }

    /**
     * https://oj.leetcode.com/problems/reverse-nodes-in-k-group/
     * https://oj.leetcode.com/submissions/detail/9355999/
     */
    public ListNode reverseKGroup(ListNode head, int k) {
        if (head == null || k <= 1)
            return head;

        int count = 0;
        ListNode p = head;
        while(count < k && p != null){
            count++;
            p = p.next;
        }

        if(count < k)
            return head;

        p = head;
        ListNode q = head;
        ListNode r = null;

        for(int i = 0; i < k; i++){
            p = p.next;
            q.next = r;
            r = q;
            q = p;
        }
        head.next = reverseKGroup(p, k);
        return r;

    }

    /**
     *
     * https://oj.leetcode.com/problems/remove-duplicates-from-sorted-array/
     * https://oj.leetcode.com/submissions/detail/9356997/
     */
    public static int removeDuplicates(int[] A) {
        if(A.length <= 1)
            return A.length;

        int k = 0;
        for (int i = 1; i < A.length; i++) {

            if(A[i] != A[k])
                A[++k] = A[i];
        }
        return k + 1;
    }

